class Mailer
{
    /**
     * @var \PHPMailer\PHPMailer\PHPMailer
     */
    private $mail;
    /**
     * @var array
     */
    private $config = [];
    private $html;
    private $archive = [];
    private $img = "";
    private $isImg = false;
    private $isArchive = false;
    private $isHtml = false;

    /**
     * Mailer constructor.
     * @param array $config
     */
    public function __construct($config = [])
    {
        $this->mail = new PHPMailer\PHPMailer\PHPMailer(true);
        $this->config = $config;
        $this->loaderMailer();
    }

    /**
     * @param $config
     */
    private function loaderMailer()
    {
        $this->mail->SMTPDebug = $this->config["mailer"]["SMTP_DEBUG"];       // Enable verbose debug output
        $this->setDriver($this->config["mailer"]["MAIL_DRIVER"]);       // Set mailer to use SMTP
        $this->mail->Host = $this->config["mailer"]["HOST"];            // Specify main and backup SMTP servers
        $this->mail->SMTPAuth = $this->config["mailer"]["AUTH"];        // Enable SMTP authentication
        $this->mail->Username = $this->config["mailer"]["USERNAME"];    // SMTP username
        $this->mail->Password = $this->config["mailer"]["PASSWORD"];    // SMTP password
        $this->mail->SMTPSecure = $this->config["mailer"]["SECURE"];    // Enable TLS encryption, `ssl` also accepted
        $this->mail->Port = $this->config["mailer"]["PORT"];            // TCP port to connect to
        $this->mail->CharSet = PHPMailer\PHPMailer\PHPMailer::CHARSET_UTF8;
    }

    private function setDriver($driver)
    {
        switch (strtolower($driver))
        {
            case "smtp" :
                $this->mail->isSMTP();
                break;
            case "mail" :
                $this->mail->isMail();
                break;
            case "sendmail":
                $this->mail->isSendmail();
                break;
            case "qmail" :
                $this->mail->isQmail();
                break;
        }
    }

    /**
     * @return \PHPMailer\PHPMailer\PHPMailer
     */
    public function Mail()
    {
        return $this->mail;
    }

    /**
     * @param string $template
     * @return BuilderMail
     */
    public function builderMail($template = "View/template.php")
    {
        return new BuilderMail($this->config["patch"] . $template);
    }

    /**
     * @param array $data
     * @return bool|string
     */
    public function sendMail($data = [])
    {
        try
        {
            $this->mail->Subject = isset($data["subject"]) ? $data["subject"] : "test";
            $this->mail->setFrom(
                $data["from"]["mail"],
                isset($data["from"]["name"]) ? $data["from"]["name"] : ''
            );
            
            foreach ($data["address"] as $row) {
                if(!empty($row["mail"])){
                    if (filter_var($row["mail"], FILTER_VALIDATE_EMAIL)) {
                     $this->mail->addAddress(
                            $row["mail"],
                            isset($row["name"]) ? $row["name"] : ''
                        );   
                    }
                }
            }
    

            if (!empty($data["reply"]["mail"]))
            {
                $this->mail->addReplyTo(
                    $data["reply"]["mail"],
                    isset($data["reply"]["name"]) ? $data["reply"]["name"] : ''
                );
            }

            if (!empty($data["cc"]["mail"]))
            {
                $this->mail->addReplyTo(
                    $data["cc"]["mail"],
                    isset($data["cc"]["name"]) ? $data["cc"]["name"] : ''
                );
            }

            if (!empty($data["bcc"]["mail"]))
            {
                $this->mail->addReplyTo(
                    $data["bcc"]["mail"],
                    isset($data["bcc"]["name"]) ? $data["bcc"]["name"] : ''
                );
            }

            if (!empty($this->isHtml))
            {
                $this->mail->isHTML(true);
                $this->mail->msgHTML($this->getHtml());
            }

            if ($this->isArchive)
            {
                if(count($this->getArchive()) == 1){
                    $this->mail->addAttachment($this->getArchive()[0]);
                }else{
                    foreach ($this->getArchive() as $row)
                    {
                        $this->mail->addAttachment($row);
                    }
                }
            }
            if ($this->isImg)
            {
                $this->mail->addAttachment($this->getImg());
            }
            $this->mail->CharSet = 'UTF-8';

            return $this->mail->send();
        } catch (Exception $e)
        {
            return $e->getMessage();
        }
    }

    /**
     * @param $html
     */
    public function setHtml($html)
    {
        $this->isHtml = true;
        $this->html = $html;
    }

    /**
     * @return mixed
     */
    public function getHtml()
    {
        return $this->html;
    }

    /**
     * @return array
     */
    public function getArchive()
    {
        return $this->archive;
    }

    /**
     * @param $archive
     */
    public function setArchive($archive)
    {
        if(!empty($archive) && $this->config["patch"] != $archive){
             $this->isArchive = true;
             $this->archive[] = $archive;
        }
    }

    /**
     * @return string
     */
    public function getImg()
    {
        return $this->img;
    }

    /**
     * @param $img
     */
    public function setImg($img)
    {
        $this->isImg = true;
        $this->img = $img;
    }

    public function __destruct()
    {
    }
}


class BuilderMail
{
    private $template = "";
    private $text = "";
    private $countAction = 0;
    private $replace;

    public function __construct($file = "View/template.php")
    {
        $this->template = file_get_contents(
            ($file == "View/template.php") ? (dirname(dirname(__FILE__)) . '/proyecto/' . $file) : $file
        );
    }

    public function render($data = [])
    {
        return [];
    }

    public function title($text = "Ejemplo", $replace = ":title-page")
    {
        $this->template = str_replace(
            $replace,
            $text,
            $this->template
        );

        return $this;
    }

    public function greeting($text = "es simply dummy text of the printing and typesetting", $replace = ":greeting-page")
    {
        $this->template = str_replace(
            $replace,
            $text,
            $this->template
        );

        return $this;
    }

    public function logo($url, $img = "data:image/png;base64,", $replace = ":logo-page")
    {
        $this->template = str_replace(
            $replace,
            $img,
            $this->template
        );

         $this->template = str_replace(
            ":link-logo",
            $url,
            $this->template
        );

        return $this;
    }

    public function line($text = "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum", $replace = ":line-page")
    {
        $this->replace = $replace;
        $this->text .= "<br><span>" . $text . "</span><br>";

        return $this;
    }

    private function builderLine()
    {
        $this->template = str_replace(
            $this->replace,
            $this->text,
            $this->template
        );
    }

    public function firm($position = "Dev", $firm = "Carlos Andrés Castilla García", $tel = "", $email = "")
    {
        $this->template = str_replace(
            ':firm-page',
            $position . ": " . $firm,
            $this->template
        );

        if (!empty($tel))
        {
            $this->template = str_replace(
                '<p id="tel" style="display: none;',
                '<p id="tel" style="display: block;',
                $this->template
            );

            $this->template = str_replace(
                ':tel-page',
                $tel,
                $this->template
            );
        }
        if (!empty($email))
        {
            $this->template = str_replace(
                '<p id="email" style="display: none;',
                '<p id="email" style="display: block;',
                $this->template
            );

            $this->template = str_replace(
                ':email-page',
                $email,
                $this->template
            );
        }

        return $this;
    }



    public function dateTime($date = "20 de octubre del 2019")
    {
        $this->template = str_replace(
            ":fecha-page",
            $date,
            $this->template
        );

        return $this;
    }

    public function qr($url = "Example", $name = "code", $qrCode = "12345685412")
    {
        $this->template = str_replace(
            ":qr-link",
            "https://api.qrserver.com/v1/create-qr-code/?size=150x150&data=" . $url,
            $this->template
        );
        $this->template = str_replace(
            ":qr-url",
            $url,
            $this->template
        );
        $this->template = str_replace(
            ":qr-name",
            $name,
            $this->template
        );
        $this->template = str_replace(
            ":qr-code",
            $qrCode,
            $this->template
        );

        return $this;
    }

    public function url_et($url_et = "Example_et")
    {
        $this->template = str_replace(
            ":url_et",
            $url_et,
            $this->template
        );
        return $this;
    }

