        "address" => "Calle 44 No 57 - 41",
        //direccion
        "pbx" => "3804222",
        //numero pbx
        "redes" => "Twitter @ADR_Colombia / AgenciaDesarrolloRuralCo",
        //redes sociales
        "url" => "gammacorp.co"
        //url compañia
    ])
    {
        $this->template = str_replace(
            ":name-empresa",
            $data["name"],
            $this->template
        );
        $this->template = str_replace(
            ":gestion-empresa",
            $data["gestion"],
            $this->template
        );
        $this->template = str_replace(
            ":agencia-empresa",
            $data["agencia"],
            $this->template
        );
        $this->template = str_replace(
            ":email",
            $data["email"],
            $this->template
        );
        $this->template = str_replace(
            ":address",
            $data["address"],
            $this->template
        );
        $this->template = str_replace(
