    public function action($text = "action", $url = "link.com")
    {
        if ($this->countAction > 0)
        {
            return $this;
        }

        $this->template = str_replace(
            '<td style="padding: 20px 0 0 0; display: none">',
            '<td style="padding: 20px 0 0 0; display: block">',
            $this->template
        );

        $this->template = str_replace(
            ':action-page',
            $text,
            $this->template
        );
        $this->template = str_replace(
            ':action-send-page',
            $url,
            $this->template
        );
        $this->countAction++;

        return $this;
    }

    public function footer($text = "©2019 Dev-Zeros. All rights reserved.", $name = "zeros", $link = "zeros.com")
    {
        $this->template = str_replace(
            ':footer-page',
            "{$text} <a href='{$link}' target='_blank' style='color: blue'>{$name}</a>",
            $this->template
        );

        return $this;
    }

    public function footerImg($img = "data:image/png;base64,", $replace = ":logo-footer-page")
    {
        $this->template = str_replace(
            $replace,
            $img,
            $this->template
        );

        return $this;
    }


    public function changeUTF8(){
        /*
        á -> &aacute;
        é -> &eacute;
        í -> &iacute;
        ó -> &oacute;
        ú -> &uacute;
        ñ -> &ntilde;
      */
        $change = [
            "á" => "&aacute;",
            "Á" => "&Aacute;",
            "é" => "&eacute;",
            "É" => "&Eacute;",
            "í" => "&iacute;",
            "Í" => "&Iacute;",
            "ó" => "&oacute;",
            "Ó" => "&Oacute;",
            "ú" => "&uacute;",
            "Ú" => "&Uacute;",
            "ñ" => "&ntilde;",
            "Ñ" => "&Ntilde;",
        ];
        foreach ($change as $key => $row) {
          $this->template = str_replace($key,$row,$this->template);
        }
    }

    public function build()
    {
        $this->builderLine();
        $this->changeUTF8();
        return $this->template;
    }
}